tables.table_schema:
CREATE TABLE invoices (
  invoice_id SERIAL PRIMARY KEY,
  consultation_id INT NOT NULL,
  total_amount DECIMAL(10, 2) NOT NULL,
  invoice_status VARCHAR(50) NOT NULL
);

CREATE TABLE insurance_claims (
  claim_id SERIAL PRIMARY KEY,
  invoice_id INT NOT NULL,
  insurer_name VARCHAR(100) NOT NULL,
  claim_status VARCHAR(50) NOT NULL
);

CREATE TABLE patients (
  patient_id INT PRIMARY KEY,
  patient_name VARCHAR(255),
  insurance_provider VARCHAR(255),
  insurance_policy_number VARCHAR(50)
);

CREATE TABLE clinicians (
  clinician_id INT PRIMARY KEY,
  clinician_name VARCHAR(255),
  license_number VARCHAR(20)
);

CREATE TABLE Psychiatrists (
    psychiatrist_id UUID PRIMARY KEY,
    psychiatrist_name VARCHAR(50) NOT NULL,
    specialization VARCHAR(50),
    license_number VARCHAR(15) NOT NULL
);

CREATE TABLE Billing (
    billing_id UUID PRIMARY KEY,
    consultation_id UUID NOT NULL,
    total_amount DECIMAL(10, 2) NOT NULL,
    payment_status VARCHAR(20) NOT NULL
);

CREATE TABLE InsuranceClaims (
    claim_id UUID PRIMARY KEY,
    billing_id UUID NOT NULL,
    claim_date DATE NOT NULL,
    claim_status VARCHAR(20) NOT NULL
);
